import './category.style.scss'
function App() {
  const categories = [
    {
      id: 1,
      title: 'Hat',
    },
    {
      id: 2,
      title: 'Jackets',
    },
    {
      id: 3,
      title: 'Sneakers',
    },
    {
      id: 4,
      title: 'Women',
    },
    {
      id: 5,
      title: 'Men',
    }
 ]
  return (
    <div className="categories-container">
      { categories.map(({title,id}) =>  (
        <div key={id} className="category-container">
          <div className="background-image" />
          <div className="category-body-container">
              <h2>{title}</h2>
              <p>Shop Now</p>
          </div>
        </div>
      ))

      }
    </div>
  );
}

export default App;
